import React from "react";
import { Container, SearchBar, SearchInput, SearchIcon, MyButton } from "./Styles";

const Search = () => {
  return (
    <Container>
      <SearchBar>
        <SearchInput>
          <SearchIcon>
            <MyButton type="submit">
              <i className="fas fa-search"></i>
            </MyButton>
          </SearchIcon>

          <input
            type="text"
            name="repo"
            id="repo"
            placeholder="Search repositorie"
          />
        </SearchInput>
      </SearchBar>
    </Container>
  );
};

export default Search;
